import React, { useEffect } from "react";

function App() {
  useEffect(() => {
    // Sending a request to Flask backend
    fetch("http://127.0.0.1:5000/api/health")
      .then((response) => response.json())
      .then((data) => {
        console.log(data); // Output the data from the backend to the browser console
      })
      .catch((error) => console.error("Error fetching data:", error));
  }, []); // The empty array ensures this runs once when the component mounts

  return (
    <div className="App">
      <h1>Health Check</h1>
      <p>Check the console for the response from the Flask backend.</p>
    </div>
  );
}

export default App;
